	public static int lengthOfLongestSubstring(String s) {
		if(s.length() == 0){
			return 0;
		}
		int i = 0;
		Map<Character, Integer> array = new HashMap<>();
		int longest = 0;
		int begin = 0;
		int end = 0;
		for(i = 0;i < s.length();i ++){
			if(!array.containsKey(s.charAt(i))){
				end = i;
				array.put(s.charAt(i), i);
			} else {
				longest = (end - begin + 1) > longest ? (end - begin + 1): longest;
				begin = array.get(s.charAt(i)) + 1;
				end = begin;
				i = begin;
				array.clear();
				array.put(s.charAt(begin), begin);
			}
		}
		longest = (end - begin + 1) > longest ? (end - begin + 1): longest;
		
		return longest;
    }
	public static int lengthOfLSS(String s){
		if(s.length() == 0){
			return 0;
		}
		int i = 0;
		int longest = 0;
		int begin = 0;
		int end = -1;
		String sub;
		for(i = 0;i < s.length();i ++){
			sub = s.substring(begin, end + 1);
			int index = sub.indexOf(s.charAt(i));
			if(index == -1){
				end = i;
			} else {
				longest = (end - begin + 1) > longest ? (end - begin + 1): longest;
				begin = begin + index + 1;
				end = i;
			}
		}
		longest = (end - begin + 1) > longest ? (end - begin + 1): longest;
		
		return longest;
	}	
